import React from "react";
import { Link } from "react-router-dom";

export default class Menu extends React.Component {

    render() {
        return(
            <div className="row bg-light fixed-top py-2 px-4">
                <div className="col-12 d-flex align-items-center ">
                    <h1> Artio </h1>
                    <Link to="/" className="mx-3"> Inicio </Link>
                    <Link to="/nosotros" className="mx-3"> Sobre Nosotros </Link>
                    <Link to="/teams" className="mx-3"> Teams </Link>
                    <Link to="/contactos" className="mx-3"> Contactos </Link>
                    <Link to="/lanzamientos" className="mx-3"> Lanzamientos </Link>
                </div>
             </div>
        )
    }
}
